import React from 'react'

const Header = () => {
  return (
    //style="display: block
    <div>
       <button class="btn" id="loginButton" ><a href="/login" style="color:black;">Login/Register</a></button>
       <button class="btn1" id="userButton" style="border-radius: 80%;width: 50px;font-size: 22px; background-color: rgb(59, 165, 165); color :white;transform:translateX(40%); display: none;"><div id="username"></div></button>
    </div>
  )
}

export default Header
